	public static List<String> getList(String _values) {
		List<String> list = new ArrayList<>();
		if (_values == null) {
			return list;
		}
		String[] values = _values.split("~");
		int count = values.length;
		for (int i = 0; i < count; i++) {
			list.add(values[i]);
		}
		return list;
	}

	public static EOImage getAvitarImgForMale(String entityName) {
		Map<String, Object> map = new HashMap<>();
		map.put("className", "EOImage");
		String detail = VSPLUtil.DEFAULT_BOYS_IMG_BYTES;

		map.put("entityName", entityName);
		DBServices.create(EOObject.createObject(map));
		EOImage eoImage = (EOImage) EOObject.getLatestObject("EOImage");
		eoImage.postSave(eoImage, detail);
		return eoImage;
	}
	
